&lt;p&gt;&lt;strong&gt;Descripci&oacute;n:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Usamos los mejores materiales para la fabricaci&oacute;n de nuestros sof&aacute;s, espumas de alta densidad con calidad ISO&nbsp;&lt;span&gt;9001- 2008 100&lt;/span&gt;&nbsp;&lt;br&gt;Madera seca&nbsp;&lt;br&gt;Banda el&aacute;stica&nbsp;&lt;br&gt;Telas con dise&ntilde;os exclusivos y de f&aacute;cil limpieza lo cual nos permite garantizar nuestro producto.&nbsp;&lt;br&gt; todo 100% colombiano.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Caracter&iacute;sticas: &nbsp;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;1. sofacama con herraje alem&aacute;n tipo carro&nbsp;&lt;br&gt;2. espaldar con herraje click clack&nbsp;&lt;br&gt;3. espumas de alta densidad para mayor confort&nbsp;&lt;br&gt;4.fibra siliconada con mezcla en espuma de alta densidad para mayor resilencia y confort&nbsp;&lt;br&gt;5. tela micro fibra de f&aacute;cil limpieza&nbsp;&lt;br&gt;6. garant&iacute;a 1 a&ntilde;o en estructura de madera y herrajes&nbsp;&lt;br&gt;7. colores: rojo, negro y chocolate&nbsp;&lt;br&gt;8. patas de madera&nbsp;&lt;/p&gt;
&lt;p&gt;Medidas: &nbsp;sof&aacute;: 163 cmts ancho x 90 de largo x 80 cmts de alto&nbsp;&lt;br&gt;sofacama : 163 cmts ancho x 175 cmts de largo x 48 cmts de alto &nbsp;&lt;strong&gt;&lt;br&gt;&lt;/strong&gt;&lt;/p&gt;
